import io from 'socket.io-client';


const Chat = () => {
	const ENDPOINT = 'localhost:5000';

	someFunct(() => {
		socket = io(ENDPOINT);

		socket.emit('test', "WAS THIS SUCCESSFUL?");

	})


	return (
		<h1> CHAT </h1>
		)
}

export default Chat;
